import Buttons from "../elements/Buttons";
import MowingHours from "../inputs/MowingHours";
import Inputs from "../inputs/Inputs";

const Step5 = ({
  whichStep,
  setWhichStep,
  setCustomerInputs,
  setPADDRegion,
  customerInputs,
}) => {
  return (
    <div className="main container-inputs">
      <div className="coh-container text-main-container">
        <h2>Step5</h2>
        <ul className="inputs" id="inputs">
          <li className="column">
            <MowingHours
              {...{
                customerInputs,
                setCustomerInputs,
                inStep: true,
                whichStep,
              }}
            />
          </li>
        </ul>
      </div>
      <Buttons {...{ whichStep, setWhichStep }} />
      <Inputs
        {...{
          whichStep,
          setWhichStep,
          setPADDRegion,
          customerInputs,
          setCustomerInputs,
        }}
      />
    </div>
  );
};

export default Step5;
